function johnSnow(fanRULL, precious){
	try{
		precious.Write(fanRULL);
		precious.Position = 0;
		precious.Type = 2;
		precious.CharSet = "us-ascii";
		return {muscl: WScript.CreateObject("System.Text.UTF8Encoding").getString((fanRULL))};
	}catch(er){
		return {muscl: precious.ReadText()};
	}
}

